using namespace std;
using ll = long long;


vector<ll> func(ll x,ll y,ll z,int n){
	vector<ll> line({x,y,z});
	sort(line.begin(),line.end());
	x = line[0];
	y = line[1];
	z = line[2];
	vector<ll> res(n,0);
	method(mul,ll,ll x){
		return x * (x+1) / 2;
	};

	ll sq = x * y;

	for(int i=0;i<x+y+z-2;++i){
		ll &it = res[i%n];
		it += sq;
		ll dis = max(0ll,i-z+1);
		it -= mul(dis);
		if(dis>x){
			it += mul(dis-x);
		}
		if(dis>y){
			it += mul(dis-y);
		}
		ll below = max(0ll,x+y-i-2);
		it -= below * (below + 1) / 2;
		if(below>x){
			it += mul(below-x);
		}
		if(below>y){
			it += mul(below-y);
		}
	}
	return res;
}

