vec add(vec a, vec b){
    for(int i=0;i<n;i++){
        a[i] += b[i];
    }
    return a;
}

vec mul(vec a, ll k){
    for(auto &x : a){
        x *= k;
    }
    return a;
}

vec solve(ll a, ll b, int p){
    if(a==0 || b==0) return vec(n,0);
    if(a>=n) return add(vec(n,b*(a/n)), solve(a%n, b, p));
    else if(b>=n) return add(vec(n,a*(b/n)), solve(a, b%n, p));
    vec imos(n*3+1), res(n);
    for(int i=0;i<b;i++){
        imos[p+i]++;
        imos[p+a+i]--;
    }
    for(int i=0;i<n*3;i++){
        imos[i+1] += imos[i];
    }
    for(int i=0;i<n;i++){
        res[i] = imos[i]+imos[i+n]+imos[i+n*2];
    }
    return res;
}

