		sum[len%n]+=(ll)max(0LL,len-1LL+min(0LL,oute+1)+min(0LL,outs+1));
		if(outw>=0)sum[len%n]++;
		if(oute>=0)sum[len%n]++;
		if(outn>=0)sum[len%n]++;
		if(outs>=0)sum[len%n]++;
		if(prev==sum[len%n])break;
		len++;
	}
	for(int i=0;i<n;i++){
		sum2[i+1]=sum2[i]+sum[i];
