		ll rest=outd%n;
		if(rest+i<=n)res[i]+=sum2[rest+i]-sum2[i];
		else res[i]+=sum2[n]-sum2[i]+sum2[(rest+i)%n];
	}
	for(int i=0;i<n;i++){
		printf("%lld%c",res[(i+n-1)%n],i==n-1?'\n':' ');
	}
