  /*
  for(int i=0; i<N; i++) {
    cerr << ans_z[i] << " \n"[i+1 == N];
  }
  */

  // y-axis
  vector<ll> ans_y(N);
  ll sa = B + 1, sb = Y - B;

  // solve (a)
  ll div = sa / N, mod = sa % N;
  for(int i=0; i<N; i++) {
    ll mul = div + (i < mod);
    for(int j=0; j<N; j++) {
      ans_y[(j+i+N)%N] += mul * ans_z[j];
    }
  }

  // solve (b)
  div = sb / N, mod = sb % N;
  for(int i=0; i<N; i++) {
    ll mul = div + (i < mod);

    // do not overlap
    if(i == 0) mul--;

    for(int j=0; j<N; j++) {
      // fprintf(stderr, "index = %d, mul = %lld, j = %d\n", (j+i+N)%N, mul, j);
