  div = sa / N, mod = sa % N;
  for(int i=0; i<N; i++) {
    ll mul = div + (i < mod);
    for(int j=0; j<N; j++) {
      ans[(j+i+N)%N] += mul * ans_y[j];
    }
  }

  div = sb / N, mod = sb % N;
  for(int i=0; i<N; i++) {
