    if(i == 0) mul--;

    for(int j=0; j<N; j++) {
      ans[(j+i+N)%N] += mul * ans_y[j];
    }
  }

  for(int i=0; i<N; i++) {
    cout << ans[i] << " \n"[i+1 == N];
  }
  return 0;
}

