inline ll get_S(int x) {
    return x < 0 ? 0 : S[x];
}

ll solve(int A, int B, int C, int K) {
    if (A < 0 || B < 0 || C < 0 || K < 0)
        return 0;
    return get_S(K) - get_S(K - A - 1) - get_S(K - B - 1) - get_S(K - C - 1) + get_S(K - A - B - 2) + get_S(K - A - C - 2) + get_S(K - B - C - 2) - get_S(K - A - B -C - 3);
}

int main() {
    S[0] = 1;
    for (int i = 1; i <= 5000000; i++)
        S[i] = S[i - 1] + i + 1;
    for (int i = 1; i <= 5000000; i++)
        S[i] += S[i - 1];

    scanf("%d %d %d %d %d %d", &X, &Y, &Z, &a, &b, &c);
    scanf("%d", &n);

    num[0] = 1; int p;
    for (int k = 1; ; k++) {
        ll &sum = num[k];
        sum += solve(X - 1 - a, Y - 1 - b, Z - 1 - c, k);
        sum += solve(X - 1 - a, Y - 1 - b, c - 1, k - 1);
        sum += solve(X - 1 - a, b - 1, Z - 1 - c, k - 1);
        sum += solve(a - 1, Y - 1 - b, Z - 1 - c, k - 1);
        sum += solve(X - 1 - a, b - 1, c - 1, k - 2);
        sum += solve(a - 1, Y - 1 - b, c - 1, k - 2);
        sum += solve(a - 1, b - 1, Z - 1 - c, k - 2);
