void Cube(ll xx, ll yy, ll zz){
	if(xx <= 0 || yy <= 0 || zz <= 0) return;
	if(yy > zz) swap(yy,zz);
	if(xx > yy) swap(xx,yy);
	if(yy > zz) swap(yy,zz);
	if(zz > xx+yy){
		for(ll i = 1; i < xx; i++) num[(i+2)%n] += i*(i+1)/2;
		for(ll i = xx; i < yy; i++) num[(i+2)%n] += i*(i+1)/2-(i-xx)*(i-xx+1)/2;
		for(ll i = yy; i < xx+yy-1; i++) num[(i+2)%n] += i*(i+1)/2-(i-xx)*(i-xx+1)/2-(i-yy)*(i-yy+1)/2;
		for(ll i = xx+yy-1; i <= zz; i++) num[(i+2)%n] += xx*yy;
		ll j = xx+yy+zz+1;
		for(ll i = 1; i < xx; i++) num[(j-i)%n] += i*(i+1)/2;
		for(ll i = xx; i < yy; i++) num[(j-i)%n] += i*(i+1)/2-(i-xx)*(i-xx+1)/2;
		for(ll i = yy; i < xx+yy-1; i++) num[(j-i)%n] += i*(i+1)/2-(i-xx)*(i-xx+1)/2-(i-yy)*(i-yy+1)/2;

	} else{
		for(ll i = 1; i < xx; i++) num[(i+2)%n] += i*(i+1)/2;
		for(ll i = xx; i < yy; i++) num[(i+2)%n] += i*(i+1)/2-(i-xx)*(i-xx+1)/2;
		for(ll i = yy; i < zz; i++) num[(i+2)%n] += i*(i+1)/2-(i-xx)*(i-xx+1)/2-(i-yy)*(i-yy+1)/2;
		for(ll i = zz; i <= xx+yy-1; i++) num[(i+2)%n] += i*(i+1)/2-(i-xx)*(i-xx+1)/2-(i-yy)*(i-yy+1)/2-(i-zz)*(i-zz+1)/2;
		ll j = xx+yy+zz+1;
		for(ll i = 1; i < xx; i++) num[(j-i)%n] += i*(i+1)/2;
		for(ll i = xx; i < yy; i++) num[(j-i)%n] += i*(i+1)/2-(i-xx)*(i-xx+1)/2;
		for(ll i = yy; i < zz; i++) num[(j-i)%n] += i*(i+1)/2-(i-xx)*(i-xx+1)/2-(i-yy)*(i-yy+1)/2;

	}
}

void Square(ll xx, ll yy){
	if(xx <= 0 || yy <= 0) return;
	if(xx > yy) swap(xx,yy);
	for(ll i = 1; i < xx; i++) num[(i+1)%n] += i;
	for(ll i = xx; i <= yy; i++) num[(i+1)%n] += xx;
	ll j = xx-1;
	for(ll i = yy+1; i <= xx+yy-1; i++){
		num[(i+1)%n] += j;
		j--;
	}
}

void Line(ll xx){
	if(xx <= 0) return;
	for(ll i = 1; i <= xx; i++) num[i%n]++;
}

