vector<ll> getxy(ll w,ll h,int st){
  vector<ll> a=vector<ll>(N);
  if( w > h ) swap(w,h);
  if( w <= 0 ) return a;
  ll cnt = 1;
  for(int i=0;i<w+h-1;i++){
    a[(st+i)%N]+=cnt;
    if( i < w-1 )
      cnt++;
    else if( i >= h-1 )
      cnt--;
  }
  return a;
}

void view(const vector<ll> v){
  for(int i=0;i<(int)v.size();i++) cout << v[i] << " ";
  cout << endl;
}


vector<ll> get(){
  vector<ll> ret = getxy(X-A,Y-B,0);
  vector<ll> a = getxy(X-A,B,1%N);
  for(int i=0;i<N;i++) ret[i] += a[i];
  a = getxy(A,B,2%N);
  for(int i=0;i<N;i++) ret[i] += a[i];
  a = getxy(A,Y-B,1%N);
  for(int i=0;i<N;i++) ret[i] += a[i];
  return ret;
}

vector<ll> solve(ll h,vector<ll> v){
  vector<ll> nv = vector<ll>(N);
  vector<ll> ret = vector<ll>(N);
  for(int i=0;i<N;i++){
    for(int j=0;j<N;j++)
      nv[(i+j)%N] += v[j];
  }
  for(int i=0;i<N;i++)
    ret[i] = nv[i]*(h/N);
  for(int i=0;i<h%N;i++){
    for(int j=0;j<N;j++)
      ret[(i+j)%N] += v[j];
  }
  return ret;
}


