	scanf("%d%d%d%d%d%d%d",&x,&y,&z,&A,&B,&C,&n);
	sum[0]=1;
	ll len=1;
	while(1){
		ll outw=A-len;
		ll oute=(x-1-A)-len;
		ll outn=B-len;
		ll outs=(y-1-B)-len;
		ll prev=sum[len%n];
		sum[len%n]+=(ll)max(0LL,len-1LL+min(0LL,outw+1)+min(0LL,outn+1));
		sum[len%n]+=(ll)max(0LL,len-1LL+min(0LL,oute+1)+min(0LL,outn+1));
		sum[len%n]+=(ll)max(0LL,len-1LL+min(0LL,outw+1)+min(0LL,outs+1));
		sum[len%n]+=(ll)max(0LL,len-1LL+min(0LL,oute+1)+min(0LL,outs+1));
		if(outw>=0)sum[len%n]++;
		if(oute>=0)sum[len%n]++;
		if(outn>=0)sum[len%n]++;
		if(outs>=0)sum[len%n]++;
		if(prev==sum[len%n])break;
		len++;
	}
	for(int i=0;i<n;i++){
		sum2[i+1]=sum2[i]+sum[i];
	}
	ll outu=C;
	for(int i=0;i<n;i++){
		res[i]+=sum2[n]*(outu/n);
		ll rest=(outu)%n;
		if(i>=rest)res[i]+=sum2[i]-sum2[i-rest];
		else res[i]+=sum2[i]+sum2[n]-sum2[n-(rest-i)];
