	ll outd=z-C-1;
	for(int i=0;i<n;i++){
		res[i]+=sum2[n]*(outd/n);
		ll rest=(outd)%n;
		if(i>=rest)res[i]+=sum2[i]-sum2[i-rest];
		else res[i]+=sum2[i]+sum2[n]-sum2[n-(rest-i)];
	}
	for(int i=0;i<n;i++){
		printf("%lld%c",res[i%n]+sum[i%n],i==n-1?'\n':' ');
	}
	return 0;
}

