int h,w,cx,cy;

bool in(int x,int y){return 0<=x && x<w && 0<=y && y<h;}

int calc2(int x1,int y1,int x2,int y2){
  if(x1 > x2) swap(x1, x2), swap(y1, y2);  
  if(x1 >= w) return 0;

  if(x1 < 0){
    if(y1 - y2 < 0) y1 += abs(x1) ,x1 = 0;
    if(y1 - y2 > 0) y1 -= abs(x1) ,x1 = 0;
  }

  if(x2 >= w){
    if(y1 - y2 < 0) y2 -= abs(x2-(w-1)) ,x2 = w-1;
    if(y1 - y2 > 0) y2 += abs(x2-(w-1)) ,x2 = w-1;
  }
  if(y1 > y2) swap(x1, x2), swap(y1, y2);
  if(y1 >= h) return 0;

  if(y1 < 0){
    if(x1 - x2 < 0) x1 += abs(y1) ,y1 = 0;
    if(x1 - x2 > 0) x1 -= abs(y1) ,y1 = 0;
  }

  if(y2 >= h){
    if(x1 - x2 < 0) x2 -= abs(y2-(h-1)) ,y2 = h-1;
    if(x1 - x2 > 0) x2 += abs(y2-(h-1)) ,y2 = h-1;
  }

  if(!in(x1,y1) || !in(x2,y2)) return 0;
  return abs(x2 - x1)+1;
}

int calc(int d){
  if(d == 0) return 1;
  return 
    calc2(cx,cy+d,cx+d,cy) + 
    calc2(cx+d,cy,cx,cy-d) +
    calc2(cx,cy-d,cx-d,cy) +
    calc2(cx-d,cy,cx,cy+d) -
    (in(cx,cy+d) + in(cx+d,cy) + in(cx,cy-d) + in(cx-d,cy));
}


